(2270, 1, '2012-02-22 00:00:00', '10:46:19 AM', 'Bill, work with Bob if necessary and signs and sites to create and post signage per the Marshal\'s request.  Many of the stairwell doors on mfg. floor have \"Roof Access Only\" signage on them.  The Marshal to my knowledge has not indicated how he wants the doors labeled which should be reflected on the alarm plan I assume.  \r\n\r\nBill listed below is how the stairways should be laid out, any questions I will be glad to come out.\r\n\r\n10.13.3.3 The sign shall be painted or stenciled on the wall or\r\non a separate sign securely attached to the wall. [101:7.2.2.5.4.3]\r\n\r\n10.13.3.4 Letters and numerals shall be of bold type and of\r\ncontrasting color to the background.\r\n\r\n10.13.3.5 The stairway identification letter shall be located at\r\nthe top of the sign in minimum 1 in. (25 mm) high lettering\r\nand shall be in accordance with 7.10.8.2 of NFPA 101.\r\n[101:7.2.2.5.4.4]\r\n\r\nNOT APPLICABLE 10.13.3.6 Roof access or the lack thereof shall be designated\r\nby a sign that reads ROOFACCESS or NO ROOFACCESS and\r\nlocated under the stairway identification letter. Lettering shall\r\nbe a minimum of 1 in. (25 mm) high and shall be in accordance\r\nwith 7.10.8.2 of NFPA 101. [101:7.2.2.5.4.5]\r\n\r\n10.13.3.7 The floor level number shall be located in the\r\nmiddle of the sign in minimum 5 in. (125 mm) high numbers\r\nand shall be in accordance with 7.10.8.2 of NFPA 101.\r\n[101:7.2.2.5.4.6]\r\n', 1, 3, 10, 'RYAN, MANN', 1, 0, 0, '2012-04-12 00:00:00', NULL, 1, 1, 0, NULL, 0, 0, 0, 0, 'bill.Donnelly@cbre-ne.com', 0, 0, 0, 0),
(2271, 1, '2012-02-23 00:00:00', '02:32:27 PM', 'Bill,  ASAP, please furnish fire pump testing reports.\r\n\r\nDo we have a valve installed at pump to discharge water?', 1, 3, 6, 'RYAN, MANN', 1, 0, 0, '2012-04-12 00:00:00', NULL, 1, 1, 0, NULL, 0, 0, 0, 0, 'bill.Donnelly@cbre-ne.com', 0, 0, 0, 0),
