(3212, 5, '2012-12-18 00:00:00', '01:53:24 PM', 'Please investigate these claims as advise property management asap.\r\n\r\nThere\'s some lighting out, both in front of the building in the dumpster area and in the back where we park trucks.  I had an electrician come by to take a look and what he found was pretty ugly.  Below\'s the note he sent me, needless to say this made me quite nervous.  I don\'t know who did the electrical work, someone on your end or a Frito-hired guy.  Either way we\'re going to need to address this pretty quickly.  Please get back to me as soon as possible.  Thanks.\r\n\r\nMichael, \r\n        Here are several pictures of what we found on site . There are several code violations which you will see in these pictures. Not having access to the landlords property to troubleshoot why the lights have no power @ this time. First the wire has to be a minimum of 18\" below the earth @ 480 volts (and this is @ any voltage) laying above ground poses a potential risk and liability. Second there are splices not in hand hole enclosures. Third someone has abandoned owners light fixture and wiring through to make these lights that are of your concern leaving him with no light @ pole before this light pole . Fourth a neutral wire has been tapped causing a great risk to a technician or even national grid, if a professional doesn\'t pay attention to this in troubleshooting/repair. My professional opinion is these wires lay in water gutter ways which could be the sole cause of the breaker tripping and why there is no power, or the time clock that controls these and has a motor which finally has burnt out needs to be replaced. Recommendation is to touch base with the owner of the property and decide if he will be paying to correct this issue or abandon this location until Frito\'s or landlord bring this electrical liability up to code. Any questions, concerns or comments feel free to call my cell\r\n', 2, 4, 7, 'RYAN, MANN', 10, 0, 0, '2012-12-05 00:00:00', NULL, 1, 0, 0, NULL, 0, 0, 0, 0, 'michael.a.barnes@pepsico.com', 0, 0, 0, 0),
